module.exports.getPetals = function (maze) {
  var results = {petals: 0, maxPetals: maze.maxPetals}

  for (var key in maze.cells) {
    var cell = maze.cells[key]
    if (cell.type === 'Floor') {
      if (cell.hasPetal) results.petals++
    }
  }

  return results
}

module.exports.savePetals = function (petal_cells, maze) {
  deletePetals(maze)

  petal_cells.forEach(function (petal_cell) {
    maze.cells[petal_cell.x + ',' + petal_cell.y].hasPetal = true
  })
}

function deletePetals (maze) {
  for (var key in maze.cells) {
    var cell = maze.cells[key]
    if (cell.type === 'Floor') cell.hasPetal = false
  }
}

module.exports.calculateMaxPetals = function (maze) {
  var petals = 0
  for (var key in maze.cells) {
    var cell = maze.cells[key]
    if (cell.type === 'Floor') {
      if (cell.hasPetal === true) {
        petals++
      }
    }
  }

  maze.maxPetals = petals
}

